import React, { useState } from 'react';
import { Link, useNavigate } from 'react-router-dom';

const RegisterPage: React.FC = () => {
  const [username, setUsername] = useState('');
  const [password, setPassword] = useState('');
  const [confirmPassword, setConfirmPassword] = useState('');
  const [error, setError] = useState('');
  const navigate = useNavigate();

  const handleRegister = (e: React.FormEvent<HTMLFormElement>) => {
    e.preventDefault();

    if (username !== '' && password !== '' && password === confirmPassword) {
      // In a real application, you would handle registration logic here
      // For this example, just redirecting to the login page
      navigate('/');
    } else {
      setError('Bitte füllen Sie alle Felder aus und stellen Sie sicher, dass das Passwort übereinstimmt.');
    }
  };

  return (
    <div>
      <h1>Registrieren</h1>
      <form onSubmit={handleRegister}>
        <div>
          <label>Benutzername:</label>
          <input
            type="text"
            value={username}
            onChange={(e) => setUsername(e.target.value)}
          />
        </div>
        <div>
          <label>Passwort:</label>
          <input
            type="password"
            value={password}
            onChange={(e) => setPassword(e.target.value)}
          />
        </div>
        <div>
          <label>Passwort bestätigen:</label>
          <input
            type="password"
            value={confirmPassword}
            onChange={(e) => setConfirmPassword(e.target.value)}
          />
        </div>
        <button type="submit">Registrieren</button>
        {error && <p style={{ color: 'red' }}>{error}</p>}
      </form>

      <div>
        {/* Link zur Login-Seite */}
        <p>Schon einen Account? <Link to="/">Login</Link></p>
      </div>
    </div>
  );
};

export default RegisterPage;
